	add("thigh", "{\"term\":\"thigh\", \"etymology\":{\"influencers\":[], \"languages\":[\"old english (ca. 450-1100)\", \"English\", \"middle english (1100-1500)\"], \"text\":\"Image:Gray1238.png|thumb|right|the right thigh of a human maleFrom Middle english (1100-1500) \u0027thighe\u0027 \u0027thehe\u0027 from Old english (ca. 450-1100) {{m|ang|þēoh}}, {{m|ang|þīoh}}, from Proto-germanic {{m|gem-pro|*þeuhą}} (compare West Frisian \u0027tsjea\u0027 Dutch \u0027dij\u0027 Middle High German {{m|gmh|diech}}, Icelandic \u0027þjó\u0027 , from Proto-indo-european {{m|ine-pro|*teuk-}} (compare Scottish Gaelic \u0027tòn\u0027 (hind, rump) Lithuanian \u0027táukas\u0027 (fat) Russian \u0027тук\u0027 (animal fat) .\"}, \"definitions\":{\"list\":[{\"upperType\":\"NOUN\", \"text\":\"The upper leg of a human, between the hip and the knee\", \"priority\":1},{\"upperType\":\"NOUN\", \"text\":\"c. 1595\u0027\u0027, \u0027Romeo and Juliet\", \"priority\":2},{\"upperType\":\"NOUN\", \"text\":\"I coniure thee by Rosalines bright eyes, By her High forehead, and her Scarlet lip, By her Fine foote, Straight leg, and Quiuering \u0027\u0027thigh\u0027\u0027, And the Demeanes, that there Adiacent lie, That in thy likenesse thou appeare to vs\", \"priority\":3},{\"upperType\":\"NOUN\", \"text\":\"1800\u0027\u0027, letter, 8 Nov 1800\", \"priority\":4},{\"upperType\":\"NOUN\", \"text\":\"About ten days ago, in cocking a pistol in the guard-room at Marcau, he accidentally shot himself through the \u0027\u0027Thigh\", \"priority\":5},{\"upperType\":\"NOUN\", \"text\":\"1991\u0027\u0027, \u0027The Llama Parlour\", \"priority\":6},{\"upperType\":\"NOUN\", \"text\":\"‘Why not pay up now, kiddo?’ he suggested magnanimously, patting me on the \u0027\u0027thigh\", \"priority\":7},{\"upperType\":\"NOUN\", \"text\":\"2011\u0027\u0027, \u0027The Guardian\u0027, 31 Mar 2011\", \"priority\":8},{\"upperType\":\"NOUN\", \"text\":\"The 23-year-old was substituted in the 75th minute of France\u0027s goalless friendly draw with Croatia on Tuesday after suffering an injury to his \u0027\u0027thigh\", \"priority\":9},{\"upperType\":\"NOUN\", \"text\":\"That part of the leg of vertebrates (or sometimes other animals) which corresponds to the human thigh in position or function; the tibia of a horse, the tarsus of a bird; the third leg-section of an insect\", \"priority\":10},{\"upperType\":\"NOUN\", \"text\":\"2009\u0027\u0027, Fred Thompson, \u0027Grillin\u0027 with Gas\", \"priority\":11},{\"upperType\":\"NOUN\", \"text\":\"Add the chicken \u0027\u0027thighs\u0027\u0027, close the bag, and squish the marinade to coat the chicken\", \"priority\":12},{\"upperType\":\"NOUN\", \"text\":\"2011\u0027\u0027, Ian Sample, \u0027The Guardian\u0027, 23 Feb 2011\", \"priority\":13},{\"upperType\":\"NOUN\", \"text\":\"The newly discovered dinosaur \u0027Brontomerus mcintoshi\u0027 may have used its huge muscular \u0027\u0027thighs\u0027\u0027 to kick predators and rivals\", \"priority\":14}]}, \"synonyms\":{}}");

