	add("thimblerig", "{\"term\":\"thimblerig\", \"etymology\":{\"influencers\":[], \"languages\":[], \"text\":\"From \u0027thimble\u0027 () + \u0027rig\u0027 ()\"}, \"definitions\":{\"list\":[{\"upperType\":\"NOUN\", \"text\":\"A game of skill which requires the bettor to guess under which of three small cups (or thimbles) a pea-sized object has been placed after the party operating the game rapidly rearranges them, providing opportunity for sleight of sleight-of-hand trickery; a shell game\", \"priority\":1},{\"upperType\":\"NOUN\", \"text\":\"One operating such a game\", \"priority\":2}]}, \"synonyms\":{}}");

