	add("thing", "{\"term\":\"thing\", \"etymology\":{\"influencers\":[], \"languages\":[], \"text\":\"See \u0027thing\u0027.\"}, \"definitions\":{\"list\":[{\"upperType\":\"NOUN\", \"text\":\"A public assembly or judicial council in a Germanic country\", \"priority\":1},{\"upperType\":\"NOUN\", \"text\":\"1894\u0027\u0027, George W. Dasent (translator), \u0027The Orkneyingers Saga\u0027, \u0027Icelandic Sagas\u0027, volume 3\", \"priority\":2},{\"upperType\":\"NOUN\", \"text\":\"But when the earl held a \u0027\u0027Thing\u0027\u0027, then Thorkell spoke on behalf of the freemen, told the need of the men, and bade the earl spare his people\", \"priority\":3},{\"upperType\":\"NOUN\", \"text\":\"1988\u0027\u0027, Patrick J. Geary, Chapter II, \u0026quot;The Barbarian World in the Sixth Century\u0026quot;, \u0027Germanic Culture\u0027, \u0027Before France and Germany: the creation and transformation of the Merovingian world\u0027, page 55\", \"priority\":4},{\"upperType\":\"NOUN\", \"text\":\"The supreme political unit of the tribe was the assembly of its free male warriors. This assembly, called the \u0026quot;\u0027\u0027Thing\u0027\u0027\u0026quot;, served as the court of highest instance for dealing with individuals who had broken fundamental elements of the tribal pact, an occasion to meet and to reinforce ties among members, and, often, an assembly which preceded a military campaign\", \"priority\":5},{\"upperType\":\"NOUN\", \"text\":\"1997\u0027\u0027, Bernard Scudder (trans.), \u0027Egil\u0027s Saga\u0027, Penguin 2001 (\u0027The Sagas of Icelanders\u0027), page 168\", \"priority\":6},{\"upperType\":\"NOUN\", \"text\":\"Before Thorstein left home, he and Asgerd decided to take Arinbjorn\u0027s gift, the silk cloak, out of Egil\u0027s chest, and Thorstein wore it to the \u0027\u0027Thing\", \"priority\":7},{\"upperType\":\"NOUN\", \"text\":\"2004\u0027\u0027, Sjúrður Skaale, \u0027The Right to National Self-Determination: the Faroe Islands and Greenland\u0027, page 46\", \"priority\":8},{\"upperType\":\"NOUN\", \"text\":\"1928 The Executive Committee of the Law \u0027\u0027Thing\u0027\u0027 is created to assume executive powers from the Governor\", \"priority\":9}]}, \"synonyms\":{}}");

	add("thingification", "{\"term\":\"thingification\", \"etymology\":{\"influencers\":[], \"languages\":[], \"text\":\"From {{suffix|thing|ification|lang\u003den}}, following \u0027thingify\u0027\"}, \"definitions\":{\"list\":[{\"upperType\":\"NOUN\", \"text\":\"The fact or process of turning something into a thing; reification\", \"priority\":1},{\"upperType\":\"NOUN\", \"text\":\"2011\u0027\u0027, \u0027Is That a Fish in Your Ear?\u0027, Penguin 2012, p. 99\", \"priority\":2},{\"upperType\":\"NOUN\", \"text\":\"Dictionaries alone aren\u0027t responsible for the \u0027\u0027thingification\u0027\u0027 of natural languages, but they crystallized a peculiar modern view of what it means to have a language\", \"priority\":3}]}, \"synonyms\":{}}");

	add("thingness", "{\"term\":\"thingness\", \"etymology\":{\"influencers\":[], \"languages\":[], \"text\":\"{{suffix|thing|ness|lang\u003den}}\"}, \"definitions\":{\"list\":[{\"upperType\":\"NOUN\", \"text\":\"The quality of a material thing; objectivity; actuality; reality\", \"priority\":1},{\"upperType\":\"NOUN\", \"text\":\"1994,\u0027\u0027 Shadia B Drury, \u0027Alexandre Kojève\u0027 [http://books.google.com/books?ie\u003dUTF-8\u0026amp;hl\u003den\u0026amp;vid\u003dISBN0312120923\u0026amp;id\u003dzQRKXLwDPc4C\u0026amp;pg\u003dPA26\u0026amp;lpg\u003dPA26\u0026amp;sig\u003dzR0NpFT9gF4Mo_VTIPTm1274piI\", \"priority\":2},{\"upperType\":\"NOUN\", \"text\":\"To live as a thing, to live for another and as the other expects, is to live unauthentically or in \u0027bad faith.\u0027 To be true to oneself, one must reduce others to \u0027\u0027thingness\u0027\u0027 and resist being so reduced\", \"priority\":3},{\"upperType\":\"NOUN\", \"text\":\"1998,\u0027\u0027 William C Chittick, \u0027The Self-Disclosure of God\u0027 [http://books.google.com/books?ie\u003dUTF-8\u0026amp;hl\u003den\u0026amp;vid\u003dISBN0791434036\u0026amp;id\u003dHKvcLT881KsC\u0026amp;pg\u003dPA46\u0026amp;lpg\u003dPA46\u0026amp;sig\u003dMwptOcI_pBuYMCxidBTxXhoKhaM\", \"priority\":4},{\"upperType\":\"NOUN\", \"text\":\"Whether we dwell in the \u0027\u0027thingness\u0027\u0027 of fixity or the \u0027\u0027thingness\u0027\u0027 of \u0027wujūd,\u0027 we are “at” the \u0027wujūd\u0027 of the Real\", \"priority\":5},{\"upperType\":\"NOUN\", \"text\":\"2002,\u0027\u0027 Kai Hammermeister, \u0027The German Aesthetic Tradition\u0027 [http://books.google.com/books?ie\u003dUTF-8\u0026amp;hl\u003den\u0026amp;vid\u003dISBN0521785545\u0026amp;id\u003dn4lGu9hu_ewC\u0026amp;pg\u003dPA176\u0026amp;lpg\u003dPA176\u0026amp;sig\u003dQuC-Pn46rPB8OFi2S9KtvMmExh0\", \"priority\":6},{\"upperType\":\"NOUN\", \"text\":\"The \u0027\u0027thingness\u0027\u0027 of a thing precedes the conscious perception of its sensual properties\", \"priority\":7}]}, \"synonyms\":{}}");

	add("thingy", "{\"term\":\"thingy\", \"etymology\":{\"influencers\":[], \"languages\":[], \"text\":\"\"}, \"definitions\":{\"list\":[{\"upperType\":\"NOUN\", \"text\":\"A thing (\u0027used in a vague way to refer to something whose name one cannot recall\", \"priority\":1},{\"upperType\":\"NOUN\", \"text\":\"2004\u0027\u0027, Richard Tinsley, \u0027Walking on the Son\", \"priority\":2},{\"upperType\":\"NOUN\", \"text\":\"He pulled out his \u0027\u0027thingy\u0027\u0027. It was huge\", \"priority\":3}]}, \"synonyms\":{}}");

