	add("thinking", "{\"term\":\"thinking\", \"etymology\":{\"influencers\":[], \"languages\":[], \"text\":\"\"}, \"definitions\":{\"list\":[{\"upperType\":\"NOUN\", \"text\":\"Gerund of think\", \"priority\":1},{\"upperType\":\"NOUN\", \"text\":\"title\u003d[http://www.economist.com/news/science-and-technology/21582495-computers-will-help-people-understand-brains-better-and-understanding-brains The machine of a new passage\u003d But how the neurons are organised in these lobes and ganglia remains obscure. Yet this is the level of organisation that does the actual \u0027\u0027thinking\u0027\u0027—and is, presumably, the seat of consciousness\", \"priority\":2}]}, \"synonyms\":{}}");

