	add("thiogalactoside", "{\"term\":\"thiogalactoside\", \"etymology\":{\"influencers\":[], \"languages\":[], \"text\":\"{{prefix|thio|galactoside|lang\u003den}}\"}, \"definitions\":{\"list\":[{\"upperType\":\"NOUN\", \"text\":\"A galactoside in which the oxygen that links the aglycone to the sugar is replaced by a sulfur\", \"priority\":1}]}, \"synonyms\":{}}");

