	add("thiosulphate", "{\"term\":\"thiosulphate\", \"etymology\":{\"influencers\":[], \"languages\":[], \"text\":\"From \u0027thio-\u0027 + \u0027sulphate\u0027.\"}, \"definitions\":{\"list\":[{\"upperType\":\"NOUN\", \"text\":\"A salt of thiosulphuric acid\", \"priority\":1},{\"upperType\":\"NOUN\", \"text\":\"2002\u0027\u0027, Philip Ball, \u0027The Elements: A Very Short Introduction\u0027, Oxford 2004, p. 46 (\u0027note\", \"priority\":2},{\"upperType\":\"NOUN\", \"text\":\"Gold sulphide is insoluble, but gold \u0027\u0027thiosulphate\u0027\u0027, compounded of gold, sulphur, and oxygen, dissolves readily enough\", \"priority\":3}]}, \"synonyms\":{}}");

