	add("thiourea", "{\"term\":\"thiourea\", \"etymology\":{\"influencers\":[], \"languages\":[], \"text\":\"From New Latin, 1890–95, {{prefix|thio|urea|lang\u003den}}.\u0026lt;ref\u0026gt;{{R:Dictionary.com}}\u0026lt;/ref\u0026gt;\"}, \"definitions\":{\"list\":[{\"upperType\":\"NOUN\", \"text\":\"Any of a class of compounds based on NH\u0026lt;sub\u0026gt;2\u0026lt;/sub\u0026gt;-CS-NH\u0026lt;sub\u0026gt;2\u0026lt;/sub\u0026gt;, formally derived from urea by replacing the oxygen atom with sulfur, used in photography as a fixing agent, in inorganic synthesis, and in medicine as an antithyroid drug.\u0026lt;ref\u0026gt;\u0026lt;/ref\u0026gt\", \"priority\":1}]}, \"synonyms\":{}}");

