	add("thirst", "{\"term\":\"thirst\", \"etymology\":{\"influencers\":[], \"languages\":[\"old english (ca. 450-1100)\", \"Danish\", \"German\", \"middle dutch (ca. 1050-1350)\", \"English\", \"middle english (1100-1500)\", \"middle high german (ca. 1050-1500)\", \"old high german (ca. 750-1050)\", \"ancient greek (to 1453)\", \"Icelandic\", \"Latin\", \"Dutch\", \"Norwegian\", \"old norse\", \"old dutch\", \"old saxon\", \"Sanskrit\", \"Albanian\", \"Swedish\"], \"text\":\"From Middle english (1100-1500) {{m|enm|thirst}}, {{m|enm|thurst}}, from Old english (ca. 450-1100) \u0027þurst\u0027 form Western Proto-germanic {{m|gem-pro|*þurstuz}}, from Proto-indo-european {{m|ine-pro|*ters-||dry}}. Cognates include Old high german (ca. 750-1050) \u0027thurst\u0027 Middle high german (ca. 1050-1500) \u0027durst\u0027 German \u0027durst\u0027 Old saxon \u0027thurst\u0027 Old dutch \u0027thursti\u0027 Middle dutch (ca. 1050-1350) \u0027dorst\u0027 \u0027dorste\u0027 Dutch \u0027dorst\u0027 Old norse \u0027þorsti\u0027 (Swedish \u0027törst\u0027 Icelandic \u0027þorsti\u0027 Danish \u0027tørst\u0027 Norwegian \u0027tørst\u0027 , non-Germanic: Ancient greek (to 1453) \u0027τέρσομαι\u0027 Albanian \u0027djersë\u0027 (sweat) Sanskrit \u0027तृष्यति\u0027 and Latin \u0027terra\u0027\"}, \"definitions\":{\"list\":[{\"upperType\":\"NOUN\", \"text\":\"A sensation of dryness in the throat associated with a craving for liquids, produced by deprivation of drink, or by some other cause (as fear, excitement, etc.) which arrests the secretion of the pharyngeal mucous membrane; hence, the condition producing this sensation\", \"priority\":1},{\"upperType\":\"NOUN\", \"text\":\"1918\u0027\u0027, w:The Land That Time Forgot The Land That Time Forgot Chapter I\", \"priority\":2},{\"upperType\":\"NOUN\", \"text\":\"quot;We haven\u0027t one chance for life in a hundred thousand if we don\u0027t find food and water upon Caprona. This water coming out of the cliff is not salt; but neither is it fit to drink, though each of us has drunk. It is fair to assume that inland the river is fed by pure streams, that there are fruits and herbs and game. Shall we lie out here and die of \u0027\u0027thirst\u0027\u0027 and starvation with a land of plenty possibly only a few hundred yards away? We have the means for navigating a subterranean river. Are we too cowardly to utilize this means?\u0026quot\", \"priority\":3},{\"upperType\":\"NOUN\", \"text\":\"A want and eager desire (for something); a craving or longing\", \"priority\":4},{\"upperType\":\"NOUN\", \"text\":\"a thirst for gold\", \"priority\":5}]}, \"synonyms\":{}}");

	add("thirstiness", "{\"term\":\"thirstiness\", \"etymology\":{\"influencers\":[], \"languages\":[], \"text\":\"{{suffix|thirsty|ness|lang\u003den}}\"}, \"definitions\":{\"list\":[{\"upperType\":\"NOUN\", \"text\":\"The property of being thirsty; thirst\", \"priority\":1},{\"upperType\":\"NOUN\", \"text\":\"It was not the heat that caused his \u0027\u0027thirstiness\u0027\u0027, it was the low humidity\", \"priority\":2}]}, \"synonyms\":{}}");

