	add("thistle", "{\"term\":\"thistle\", \"etymology\":{\"influencers\":[], \"languages\":[\"old english (ca. 450-1100)\", \"English\"], \"text\":\"From Old english (ca. 450-1100) \u0027þistel\u0027 from Proto-germanic {{m|gem-pro|*þistilaz}}. \u0027*þīh-\u0027 from \u0027*teyg-\u0027, which is a variant of Proto-indo-european {{m|ine-pro|*steyg-||to prick}}; from this same Proto-Indo-European root comes English \u0027stick\u0027 Cognates include German \u0027distel\u0027 and Icelandic \u0027þistill\u0027\"}, \"definitions\":{\"list\":[{\"upperType\":\"NOUN\", \"text\":\"Any of several perennial composite plants, especially of genera \u0027Cirsium\u0027, \u0027Carduus\u0027, \u0027Cynara\u0027 or , having prickly leaves and showy flower heads with prickly bracts\", \"priority\":1},{\"upperType\":\"NOUN\", \"text\":\"Genesis 3:18\", \"priority\":2},{\"upperType\":\"NOUN\", \"text\":\"Thorns also and \u0027\u0027thistles\u0027\u0027 shall it bring forth to thee; and thou shalt eat the herb of the field\", \"priority\":3},{\"upperType\":\"NOUN\", \"text\":\"This plant seen as the national emblem of Scotland\", \"priority\":4},{\"upperType\":\"NOUN\", \"text\":\"The Order of the Thistle, or membership thereof\", \"priority\":5},{\"upperType\":\"NOUN\", \"text\":\"1978\u0027\u0027, \u0027Livia\u0027, Faber \u0026amp; Faber 1992 (\u0027Avignon Quintet\u0027), p. 324\", \"priority\":6},{\"upperType\":\"NOUN\", \"text\":\"Here\u0027s a passage which will please you: ‘It is said that when rich he twice refused the \u0027\u0027thistle\u0027\u0027.’\", \"priority\":7}]}, \"synonyms\":{}}");

	add("thixotropy", "{\"term\":\"thixotropy\", \"etymology\":{\"influencers\":[], \"languages\":[\"English\", \"ancient greek (to 1453)\"], \"text\":\"From Ancient greek (to 1453) \u0027θίξις\u0027 (touching) + \u0027τροπή\u0027 (turning) (from Ancient greek (to 1453) \u0027τρέπω\u0027 (turn, change) .\"}, \"definitions\":{\"list\":[{\"upperType\":\"NOUN\", \"text\":\"The property of certain gels whereby they become fluids when agitated and return to being solid or semi-solid when allowed to stand\", \"priority\":1}]}, \"synonyms\":{}}");

	add("thizz", "{\"term\":\"thizz\", \"etymology\":{\"influencers\":[], \"languages\":[], \"text\":\"Alteration of \u0027\u0027\u0027thing\u0027\u0027\u0027\"}, \"definitions\":{\"list\":[{\"upperType\":\"NOUN\", \"text\":\"MDMA; Ecstasy\", \"priority\":1},{\"upperType\":\"NOUN\", \"text\":\"2008\u0027\u0027, Joseph R. Sims, \u0027Skeletons\u0027, iUniverse (2008), ISBN 9780595524983, [http://books.google.com/books?id\u003dUWNWPOj7ePYC\u0026amp;pg\u003dPA23 page 23\", \"priority\":2},{\"upperType\":\"NOUN\", \"text\":\"quot;We\u0027ve got \u0027\u0027thizz\u0027\u0027!\u0026quot; Alexis shot me a look to see if it was okay that she\u0027d mentioned it\", \"priority\":3}]}, \"synonyms\":{}}");

